BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "countries" (
	"Country_Name"	TEXT,
	"Country_Code"	TEXT,
	PRIMARY KEY("Country_Code")
);
CREATE TABLE IF NOT EXISTS "economic_indicators" (
	"country_code"	TEXT,
	"year"	INTEGER,
	"FDI_Net_CurrentUD"	REAL,
	"FDI_NetInflows_PercentGDP"	REAL,
	"FDI_NetInflows_CurrentUD"	REAL,
	"FDI_NetOutflows_PercentGDP"	REAL,
	"FDI_NetOutflows_CurrentUD"	REAL,
	"GDP_CurrentUD"	REAL,
	"GDP_Growth_Percent"	REAL,
	"General_government_final_consumption_expenditure_CurrentUD"	REAL,
	"Gini_Index"	REAL,
	"Gross_National_Expenditure_CurrentUD"	REAL,
	"Inflation_ConsumerPrices_AnnualPercent"	REAL,
	"Inflation_GDPDeflator_AnnualPercent"	REAL,
	"Inflation_GDPDeflator_AnnualPercent_LinkedSeries"	REAL,
	"MilitaryExpenditure_CurrentUD"	REAL,
	"Net_Trade_Goods_CurrentUD"	REAL,
	"Net_Trade_GoodsandServices_CurrentUD"	REAL,
	"Trade_PercentGDP"	REAL,
	"TradeServices_PercentGDP"	REAL, id INTEGER,
	PRIMARY KEY("country_code","year")
);
CREATE TABLE IF NOT EXISTS "environmental_indicators" (
	"country_code"	TEXT,
	"year"	INTEGER,
	"ElectricityAccess_PercentofPopulation"	REAL,
	"CO2Emissions_Agriculture"	REAL,
	"CO2Emissions_TransportEnergy"	REAL,
	"CO2Emissions_Waste"	REAL,
	"ForestArea_PercentofLand"	REAL,
	"RenewableEnergy_Consumption_Percent"	REAL,
	"GreenhouseGasEmissions_TotalperCapita"	REAL, id INTEGER,
	PRIMARY KEY("country_code","year")
);
CREATE TABLE IF NOT EXISTS "public_debt_indicators" (
	"country_code"	TEXT,
	"year"	INTEGER,
	"ExternalDebtStocks_LongTerm_CurrentUSD"	REAL,
	"GrossPSD_Total_AllMaturities_USD"	REAL,
	"GrossPSD_Total_LongTerm_USD"	REAL,
	"GrossPSD_Total_ShortTerm_USD"	REAL,
	"InterestPayments_PercentofExpense"	REAL,
	"PresentValue_ExternalDebt_USD"	REAL,
	"TotalDebtService_Percent"	REAL, id INTEGER,
	PRIMARY KEY("country_code","year")
);
CREATE TABLE IF NOT EXISTS "social_indicators" (
	"country_code"	TEXT,
	"year"	INTEGER,
	"LifeExpectancy_Female"	REAL,
	"LifeExpectancy_Male"	REAL,
	"LifeExpectancy_Total"	REAL,
	"LiteracyRate_AdultTotal"	REAL,
	"LiteracyRate_YouthTotal"	REAL,
	"Multidim_PovertyHeadcountRatio_UNDP"	REAL,
	"Multidim_PovertyHeadcountRatio_WorldBank"	REAL,
	"Water_BasicDrinkingServices_PercentofPop"	REAL,
	"Water_SafelyManagedDrinkingServices_PercentofPop"	REAL,
	"Water_BasicHandwashing_PercentofPop"	REAL,
	"Poverty_HeadcountRatio_NationalPovertyLines_Percent"	REAL,
	"Poverty_HeadcountRatio_SocietalPovertyLines_Percent"	REAL,
	"Unemployment_AdvancedEducation_Percent"	REAL,
	"Unemployment_BasicEducation_Percent"	REAL,
	"Unemployment_IntermediateEducation_Percent"	REAL,
	"Unemployment_Total_Percent"	REAL,
	"Unemployment_YouthTotal_Percent"	REAL, id INTEGER,
	PRIMARY KEY("country_code","year")
);
CREATE TABLE IF NOT EXISTS "statistical_indicators" (
	"country_code"	TEXT,
	"year"	INTEGER,
	"BroadMoney_Ratio"	REAL,
	"Classification_HouseholdConsumption"	REAL,
	"Classification_NationalIndustry"	REAL,
	"Classification_StatusofEmployment"	REAL,
	"GovernmentFinance_Stats"	REAL,
	"MonetaryandFinancial_Stats"	REAL,
	"OfficialExchangeRate"	REAL, id INTEGER,
	PRIMARY KEY("country_code","year")
);
CREATE UNIQUE INDEX idx_economic_indicators 
ON economic_indicators (country_code, year);
CREATE UNIQUE INDEX idx_environmental_indicators 
ON environmental_indicators (country_code, year);
CREATE UNIQUE INDEX idx_public_debt_indicators 
ON public_debt_indicators (country_code, year);
CREATE UNIQUE INDEX idx_social_indicators 
ON social_indicators (country_code, year);
CREATE UNIQUE INDEX idx_statistical_indicators 
ON statistical_indicators (country_code, year);
COMMIT;
